        private void LinkRoleToNode(FestiSpecContext context, string roleName, string permissionNode)
        {
            var role = context.Roles.SingleOrDefault(r => r.Name == roleName);
            if (role.PermissionNodes.SingleOrDefault(n => n.Permission == permissionNode) == null)
            {
                role.PermissionNodes.Add(context.PermissionNodes.Single(n => n.Permission == permissionNode));
            }
        }

        private void LinkAnswerToAttachment(FestiSpecContext context, string answerText, string attachmentText)
        {
            var answer = context.Answers.SingleOrDefault(r => r.AnswerText == answerText);
            if (answer.Attachments.SingleOrDefault(n => n.FilePath == attachmentText) == null)
            {
                answer.Attachments.Add(context.Attachments.Single(n => n.FilePath == attachmentText));
            }
        }

        private void LinkQuestionToAttachment(FestiSpecContext context, string questionText, string attachmentText)
        {
            var question = context.Questions.SingleOrDefault(r => r.QuestionText == questionText);
            if (question.Attachments.SingleOrDefault(n => n.FilePath == attachmentText) == null)
            {
                question.Attachments.Add(context.Attachments.Single(n => n.FilePath == attachmentText));
            }
        }
